,'Near to this house dwelt Saints Crispin and Crispianus, the patron saints of bootmakers. The well to which the pump is connected is St. Crispin\'s Well.',51.315399,0.891430,NULL,'[]'),(2077,'Francis Crow (c. 1755-1835), clockmaker, inventor, and geologist and his son Edward Crow (1795-1846), historian of Faversham and Mayor in 1837 lived and worked here.',51.315800,0.891220,NULL,'[]'),(2078,'Formerly the William Gibbs School for Girls founded in 1883 by Richard Gibbs in memory of his father William Gibbs. Merged with the Boys\' Grammar School in 1967 and converted into flats in 1994.',51.315201,0.895653,NULL,'[]'),(2079,'Here lived Michael Greenwood, mariner (1731/2 - 1812), who was press-ganged in 1748, wrecked off the coast of Morocco in 1758, and then enslaved by the Moors for 17 months. After being ransomed, he returned to Faversham.',51.318100,0.893945,NULL,'[]'),(2080,'Here lived Henry Hatch, merchant, adventurer and benefactor of the town. Died 1533. To this house was brought King James II when captured in attempting to leave the kingdom, December, 1688.',51.315601,0.891091,NULL,'[]'),(2081,'This house was the residence of Edward Jacob, F.S.A., the Faversham historian (Mayor 1749-54-65-75). His descendents were among the makers of British India.',51.314400,0.891381,NULL,'[]'),(2082,'Named after Edward Jacob (c 1710-1788), surgeon and historian of Faversham.',51.314602,0.891700,NULL,'[]'),(2083,'After being captured by Faversham fishermen in December 1688 while trying to escape to the continent, King James II was detained for 3 days in this house, then the home of the Mayor, Thomas Southouse, and later that of Richard Marsh, owner of this brewery',51.316101,0.891600,NULL,'[]'),(2084,'John White Masters (1791-1873) author of Dick and Sal at Canterbury Fair and pioneer of the assam tea trade lived here.',51.316601,0.891900,NULL,'[]'),(2085,'George Trench (c. 1838-1912) manager of the Cotton Powder Company and inventor of tonite, the explosive, lived in a house on this site.',51.319302,0.895602,NULL,'[]'),(2086,'C. 15th century Faversham\'s principal inn, and main centre of its coaching trade. Preacher John Wesley stayed here in 1743.',51.315800,0.891200,NULL,'[]'),(2087,'On this site stood a house which was the birthplace of Dr. John Wilson, First Master of the King\'s Music. Appointed by Charles II.',51.319302,0.895602,NULL,'[]'),(2088,'Here lived and died Henry Wreight (1760-1840), solicitor and benefactor, whose bequest made possible the provision of new almshouses, Faversham\'s recreation ground and two schools. Mayor in 1809, 1818 and 1828.',51.310001,0.893305,NULL,'[]'),(2091,'Sam Hanna Bell',54.587700,-5.933530,'2009-10-15','[]'),(2092,'Faversham Abbey Inner Gateway founded 1147, demolished 1771. The salvaged masonry was re-used in the construction of 63-64 Abbey Street. Between this point and the present \'Anchor\' Tavern was the Abbey\'s nether green.',51.319500,0.896144,NULL,'[]'),(2093,'Faversham Abbey Outer Gateway (founded 1147). Northward from here, till 1538 the precinct of Faversham Abbey. The archway was demolished in 1772 but this eastern portion of the gatehouse (c 1250) now forms part of Arden\'s House. It incorporated a small ch',51.320099,0.896800,NULL,'[]'),(2094,'One of the oldest surviving warehouses in Britain, probably from the late 17th century. Its roof is thought to be constructed from timbers from the medieval refectory of Faversham Abbey.',51.320801,0.897099,NULL,'[]'),(2095,'Abbey Street, one of Britain\'s finest medieval streets. Saved from destruction and restored in 1958. Among those responsible were Frederick Bishop, John Hallward, Geoffrey King, Herbert Richards and Sydney Wilson.',51.319302,0.895602,NULL,'[]'),(2097,'This ancient tavern, formerly the Anchor and Standard, has offered hospitality for at least 300 years',51.319302,0.895602,NULL,'[]'),(2099,'This building erected in 1980 on the site of the Argosy Cinema (1935) latterly the Regal Cinema',51.314400,0.891381,NULL,'[]'),(2100,'Opened as a suite of Assembly Rooms in 1849. This drill hall was designed by Martin Bulmer and built by Thomas Ware. It has been  used for military training since 1869.',51.314400,0.891400,NULL,'[]'),(2101,'This building was a chapel, opened in 1833, for Calvinistic Baptists but later used by Wesleyan Reform Methodists. It became the Faversham Club in 1884.',51.313599,0.893045,NULL,'[]'),(2110,'Built in 1819 to house a manually-operated, horse-drawn fire engine. This building served as the town\'s fire station till 1939 and was until 1926 staffed by a volunteer fire brigade.',51.316399,0.891749,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5067325824\\/\"}]'),(2113,'Here stood Faversham\'s second guidhall. In use from 1546 to 1603. When Queen Elizabeth I visited it in 1573 she was given a civic banquet at a cost of 27.2s- equivalent to about 5000 today.',51.316399,0.891786,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5360591425\\/\"}]'),(2120,'Birthplace of Elvis Presley. Elvis Aaron Presley was born Jan. 8 1935 in this house, built by his father. Presley\'s career as a singer and entertainer redefined American popular music. He died Aug. 16 1977 at Memphis, Tennessee.',34.259899,-88.680000,NULL,'[]'),(2121,'Edward R. Murrow\r\n1908-1965\r\nAmerican broadcaster\r\nlived here \r\nin flat No.5\r\n1938-1946',51.522099,-0.144316,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4117042233\\/\"}]'),(2122,'Florence Nightingale\r\nleft her hospital on this site for\r\nthe Crimea October 21st 1854',51.520699,-0.147750,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4117853090\\/\"}]'),(2123,'In a house\r\non this site\r\nlived from 1854-1875\r\nSir Charles Lyell\r\ngeologist\r\nand from 1876-1882\r\nW. E. Gladstone\r\nstatesman',51.519699,-0.147300,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4117860752\\/\"}]'),(2124,'Stephen Pearce\r\n1819 - 1904\r\nPortrait and Equestrian Painter\r\nlived here\r\n1856 - 1884',51.517799,-0.148840,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4117874326\\/\"}]'),(2125,'Thomas Woolner RA\r\nSculptor and poet\r\nlived here\r\n1860 - 1892',51.518200,-0.149517,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4117888490\\/\"}]'),(2126,'G. B. Edwards 1899-1976 author of The Book of Ebenezer Le Page lived here',49.487000,-2.535400,'2008-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/47332464@N08\\/5031041374\\/\"}]'),(2127,'Walter Greaves 1846-1930 artist lived here 1855-1897',51.481800,-0.175000,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/21372046@N00\\/4265772291\\/\"}]'),(2128,'George Grossmith Junior 1874-1935 actor-manager lived here',51.517399,-0.152627,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4368991242\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4368996314\\/\"}]'),(2129,'Lord Haden-Guest 1877-1960 physician lived here',51.485699,-0.160767,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4233649985\\/\"}]'),(2130,'Eagle House. A fine Queen Anne house built in the dutch style, in 1706, probably for Ferando Mendez, a Royal Physician. \r\nThe land was originally owned by Walter Raleigh.\r\nIn Victorian times, it was part of the Holborn Union Workhouse School',51.407700,-0.163590,NULL,'[]'),(2131,'The author and poet George MacDonald lived here from 1850 to 1853 while Minister of Arundel Independent Church',50.853298,-0.557600,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/54145418@N00\\/3915309701\\/\"}]'),(2132,'In this house lived Ralph Ellis 1885-1963 artist, painter & designer of inn signs',50.854000,-0.558000,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/54145418@N00\\/3916073894\\/\"}]'),(2133,'Dr G. W. Eustace, M.D. historian of Arundel, lived here 1895-1925',50.854599,-0.556500,NULL,'[]'),(2134,'Thomas Walder 1766-1861, clockmaker lived in a house on this site',50.855099,-0.557500,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/54145418@N00\\/3915263791\\/\"}]'),(2135,'This area has been known for over a century as Holder\'s Corner. It derives its name form the retail shop \"Holder\'s\" which occupied 34 Montague Street from 1900-1973. The shop traded as a haberdashers and later as a drapers and ladies\' costumiers.',50.995098,-0.297000,'2007-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/54145418@N00\\/4127833011\\/\"}]'),(2137,'Part of the\r\nMontefiore country\r\nestate, Milton Mount\r\nGardens were laid out\r\nin the mid-1880s by\r\nJames Pulham\r\n(1845-1920).\r\nThe artificial rocks\r\nare made of\r\npulhamite',51.126801,-0.148400,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4141699514\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4141698506\\/\"}]'),(2138,'In\r\nthe late\r\n1930s and 1940s\r\nSir\r\nMalcolm Campbell\r\n1885-1948\r\nworld water speed record holder\r\ntested and developed\r\nBluebird\r\non this lake\r\nknown locally as\r\nCampbell\'s lake',51.095100,-0.176100,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4140943385\\/\"}]'),(2139,'Here\r\nin the village inn\r\nquaker and\r\nprison reformer\r\nElizabeth Fry\r\n(1780-1845)\r\nin September 1837 held\r\n\'a satisfactory\r\nreading with\r\nthe people\'',51.124001,-0.218100,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4140945495\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4140944559\\/\"}]'),(2140,'In Langley\r\nLane, at his parents\'\r\nhouse Little Balgair,\r\nnow demolished,\r\nFrederick Knott\r\n(1915-2002)\r\nwrote \'Dial M For Murder\'.\r\nAfter performances on\r\ntelevision, and on London\r\nand Broadway stages,\r\nthe play was filmed by\r\nAlfred Hitchcock\r\nin 1954',51.125401,-0.212500,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4140947627\\/\"}