\r\nthe old\r\nmarket cross.\r\nPublic meetings were\r\nheld here in the\r\n18th century',52.476200,-1.894140,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/3832541141\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/3832541869\\/\"}]'),(2148,'This plaque\r\ncommemorates a conference\r\nheld near this spot on\r\nthe 3rd day of May 1655\r\nof ministers and messengers of\r\nthe following baptist churches\r\nAlcester, Bourton-on-the-Water\r\nDerby, Hook-Norton, Moreton-in-Marsh\r\nTewkesbury and Warwick\r\nfrom whi',52.281700,-1.583600,'1955-05-17','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/3833342766\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/3832547667\\/\"}]'),(2149,'Oken\'s House\r\nHere lived\r\nThomas Oken\r\na great benefactor\r\nto Warwick\r\nHe died here on\r\nthe 29th July 1573',52.280602,-1.586800,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/3832545555\\/\"}]'),(2150,'During the 1890\'s the\r\nEarl (Francis Greville) and Countess (Frances Evelyn \"Daisy\" Greville) of Warwick\r\nheld many house parties at the Castle.\r\n\r\nAmong the principal guests on the\r\noccasion portrayed here was\r\nH.R.H The Prince of Wales\r\nwho later became',52.279400,-1.584800,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/3833337534\\/\"}]'),(2151,'Wingrove House\r\nColonial style building of 1870\r\nused as accommodation by trainer\r\nHarry Batho, racing manager to\r\nHoratio Bottomly. It later became an\r\nhotel and the adjacent stables and\r\nexercise yard facing the Tye were\r\nconverted to residences.',50.807098,0.156900,'2006-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/3783732783\\/\"}]'),(2152,'United Reformed Church\r\nBuilt in 1801 as Alfriston\'s first\r\nnon-conformist chapel. The scene of \r\na fracas on 11 December 1831 when\r\nCharles Brooker, senior trustee of\r\nthe Congregational Church, used\r\ns