{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/5026594226\\/\"}]'),(3790,'George Alexander Macfarren Knt\r\nLived in this house\r\nand died here 1887',51.528301,-0.177357,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/5026626510\\/\"}]'),(3796,'English author George Borrow 1803-1881 lived here between Dec. 1859-June 1860\r\n\r\nMost famous books \"The Bible In Spain\" and \"Lavengro\"',52.605400,1.735210,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3871581849\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3871584831\\/\"}]'),(3798,'Railway station built 1845 on the Norwich to Brandon Railway, later the G.E.R. and L.N.E.R. line to London. Restored 1989 by David Turner.',52.565399,1.117910,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4612684005\\/\"}]'),(3800,'David Mocatta 1806-1882 Anglo-Jewish architect remodelled this building as the City\'s first purpose built Synagogue in 1838',50.821400,-0.131102,'2007-07-29','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/64097751@N00\\/3294902970\\/\"}]'),(3802,'Brian Epstein (Inscription needed)',51.514702,-0.126872,'2010-09-28','[]'),(3804,'1509-2009 This rock commemorates the life and bequest of William Godell who left land to the town on trust forever',52.345600,1.676230,'2009-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3871753743\\/\"}]'),(3806,'The Bassingham Gateway Formerly the entrance to the house in London Street of John Bassingham, goldsmith during the reign of Henry VIII. It was erected here in 1857',52.628700,1.291820,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3867999781\\/\"}]'),(3808,'Aeronautical Firsts\r\n\r\nIn 1797 William Moore founded a company close to this site which was eventually to become Boulton & Paul Ltd. This company developed the first all metal framed aeroplane with the first ever major use of plastic in an aircraft in the',52.629200,1.294650,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868788164\\/\"}]'),(3810,'Louis Marchesi 1898-1968\r\nFounder of the Round Table Movement and owner of Langford\'s Restaurant which stood on this site where Table No.1 meetings took place.',52.629902,1.295510,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868790548\\/\"}]'),(3812,'2-4 St Andrews Hill\r\n\r\nA 17th century building in what was once a medieval thoroughfare, converted to two residential units with a shop below. The street facade shows shows at least four different phases of brickwork and flint rubble, evidence of past alt',52.629902,1.295900,'1991-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868792754\\/\"}]'),(3814,'First Provincial Newspaper\r\n\r\nThe Norwich Post, England\'s first provincial newspaper, was first printed on this site in 1701 by Francis Burges. The City also claims the record for the longest continuously printed local newspaper, the Norwich Mercury, foun',52.628899,1.294640,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868795322\\/\"}]'),(3816,'Jonathan Davey 1760-1814 of Eaton Hall an Alderman of the City built this pedestrian way in 1812',52.628399,1.294460,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868801516\\/\"}]'),(3818,'Reverend William D\'Oyley 1745-1814 in his old age rode 12,000 miles on horseback collecting subscriptions for the widening of this street',52.626999,1.293510,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868023367\\/\"}]'),(3820,'John Exton, M.D. Mayor of Lynn 1735 lived here',52.754902,0.395091,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868845026\\/\"}]'),(3822,'Outer Purfleet\r\n\r\nPurfleet was the main harbour inlet of medieval Lynn, and originally much wider. Purfleet Quay was built in 1547. On this site stood Hull Warehouse (c1680), a tall granary (c1900), and then grain silos (1964-92). The dock was created in ',52.753502,0.392619,'2005-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868087111\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868084583\\/\"}]'),(3824,'Bank House \r\nKing\'s Staithe Square\r\n\r\nSite of the medieval Tolbooth, facing Bishop\'s Staithe. House of 1682, and a former Custom House. West wing built c1750. In 1782 became Gurney & Birkbeck\'s Lynn Bank, with a Counting House built in 1788.',52.753201,0.393027,'2005-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868089553\\/\"}]'),(3826,'Peter Tatchell. Born 1952. Campaigner for human rights, gay freedom and social justice. Lived Here. ',51.495998,-0.095644,'2010-10-29','[]'),(3828,'Captain Samuel Cresswell 1827-1867 \r\n\r\nArctic explorer born here',52.753201,0.393041,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868091825\\/\"}]'),(3830,'(opposite this plaque is the)\r\nCustom House\r\n\r\nBuilt as a Merchant\'s Exchange in 1683 by Henry Bell for Sir John Turner. Altered in 1718 and 1744. From 1693 to 1989 this was the Port Office for HM Customs, and it is \"one of the finest late 17C public buil',52.753899,0.393475,'2005-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868095131\\/\"}]'),(3834,'Captain\r\nAlexander Musgrave\r\nwho sailed against the Spanish Armada 1588 lived in a house on this site',52.754101,0.393461,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868103893\\/\"}]'),(3836,'West Norfolk and King\'s Lynn High School for Girls\r\n1902-1979',52.755100,0.393633,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868111519\\/\"}]'),(3838,'28-32 King Street\r\n\r\nWithin 30-32 are the remains of a stone house built c.1200, the oldest in Lynn. About 1300, the timber framed row of houses and shops at 28-30 was built over and beside the stone house.',52.755001,0.393872,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868114117\\/\"}]'),(3840,'29 King Street\r\nShakespeare House\r\n\r\nThis is a late C15 \'hall house\' of timber and brick with an 1810 front wall, and added rooms c1780 beside the Guildhall. Formerly the Shakespeare public house, this name referred to the Guildhall\'s use as a theatre in ',52.755199,0.393988,'2005-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868917328\\/\"}]'),(3842,'21 Tuesday Market Place\r\n\r\nErected in 1768 for George Hogge, a wealthy merchant. In 1869 the building was bought by Gurney\'s Bank; their successors Barclay\'s, refronted it in the original style in 1957. Site of Custom House 1620-1703.',52.756100,0.393533,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868931292\\/\"}]'),(3844,'Corn Exchange\r\n\r\nBuilt in 1854. Designed by Cruso & Maberley of Lynn, the front facade is surmounted by the goddess Ceres. Site of Market Hall 1830-1854, and previously of the Angel Inn.',52.756302,0.393644,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868938114\\/\"}]'),(3846,'18 Tuesday Market Place \r\nOldest parts are 15th century, the southern half was refronted c.1725 and the northern bay rebuilt in 1803. Rear wings demolished 1975. Maltings remain to the west. The Bagge merchant family, brewers and bankers, occupied these p',52.756699,0.394341,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868160523\\/\"}]'),(3848,'Bennett\'s Yard\r\n21 St Nicholas Street\r\n\r\nThis 15 century arch originally led under a house to a tenement yard behind. Primitive Methodists in Norfolk first met here in 1821. The house became ruinous and was demolished in 1951.',52.756901,0.395430,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868944148\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868168877\\/\"}]'),(3850,'Tudor Rose Hotel\r\n\r\nC15 front door and crown post roof in hall range on the left, joined by a first floor gallery to St Nicholas\' House, to the right (a classical east gable is dated 1645). These buildings faced north into the courtyard of a mansion house',52.757000,0.395841,'2005-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3868175099\\/\"}]'),(3852,'Coastguard Lookout\r\n\r\nVisited by King George VI, Queen Elizabeth, and princesses Elizabeth and Margaret\r\n\r\n24th April 1943',52.950802,0.494252,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3871533799\\/\"}]'),(3854,'Coastguard Lookout\r\n\r\nRoyal observer post 1907\r\n\r\nCoastguard service 1963-8',52.951000,0.493880,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3871537173\\/\"}]'),(3856,'Lighthouse\r\n1665-1921\r\n\r\nWorld\'s first parabolic reflector 1776',52.949501,0.493775,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3872328596\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3872324856\\/\"}]'),(3858,'On this site stood the\r\n\r\nTheatre Royal\r\n\r\n1778-1929',52.607399,1.727760,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3872421206\\/\"}]'),(3860,'Gt. Yarmouth Wall\r\nSite of Oxney\'s Gate\r\nDemolished 1776',52.606899,1.728560,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3872424176\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3872426912\\/\"}]'),(3862,'H.M. Customs\r\nCoat Of Arms\r\n\r\nThe arms which are placed on this wall, are the property of H.M. Customs and formerly stood above the porch of the Port\'s Custom House, 20 South Quay, the adjacent building to this to the north, now the offices of the Great Y',52.604198,1.726290,'1994-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3872455288\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3872450140\\/\"}]'),(3864,'The Old Dutch Chapel\r\n\r\nThis wall is the last remaining vestige of one of the most important of the old buildings in the Town, locally known as the Old Dutch chapel or Town House. \r\nThe building, which dates from early fourteenth century (once owned by Th',52.604000,1.726440,'1994-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3872462376\\/\"}]'),(3866,'The Old Custom House\r\nThis building was constructed as a private house in 1720 by a prominent merchant in the town, \r\nJohn Andrews\r\nIt was used by HM Customs as the port\'s customs office from 1812-1984, when it was acquired by the Great Yarmouth Port and ',52.604198,1.726080,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3871685807\\/\"}]'),(3868,'James Maggs\r\nDiarist. 1797-1890.\r\nlived here',52.324902,1.678220,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3871765591\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3871772701\\/\"}]'),(3870,'Quaker Cottage\r\n(Grade II)\r\n\r\nThis cottage, built in 1715, was given to the Quakers in 1759 by Philip Sewell, a local wool trader.\r\n\r\nThe Friends Meeting House was built at the rear in 1744.',52.457802,1.564190,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3873412487\\/\"}]'),(3872,'Site of Bungay Grammar School\r\n\r\nEstablished in 1565, originally in St Mary\'s Churchyard.\r\n\r\nThe School moved to this site in 1580 and remained here until 1925',52.456402,1.434330,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3876019180\\/\"}]'),(3874,'The Old Grammar School\r\n\r\nFounded in 1567 by Archbishop of Canterbury. Originally housed in Becket\'s Chapel, the school moved to this and neighbouring buildings 1835-1903',52.571800,1.110050,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3875282615\\/\"}]'),(3876,'In 1549 AD Robert Kett yeoman farmer of Wymondham was executed by hanging in this castle after the defeat of the Norfolk Rebellion of which he was the leader\r\nIn 1949 AD - four hundred years later - this memorial was placed here by the citizens of Norwich',52.628201,1.296260,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3875345917\\/\"}]'),(3878,'Norwich Hippodrome\r\n\r\nAlso known as the Grand Opera House, the Hippodrome opened in 1903 and hosted a multitude of famous acts including Laurel & Hardy and the young Archie Leach before he went on to become the more famous Cary Grant',52.629101,1.291200,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3875460869\\/\"}]'),(3880,'Gladstone House\r\nHome of\r\nJohn Harvey 1755-1842\r\nHe became Sheriff in 1784, Mayor in 1792 and High Sheriff of Norfolk in 1825.\r\nHe revived horse racing on Mousehold and introduced shawl weaving to Norwich in 1791',52.629101,1.291200,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3876251860\\/\"}]'),(3882,'Wellington Mews stands on the site of Welco Works - home of Buckler cars and karts from 1949 to 1965\r\n\r\nThis plaque was erected by the Buckler Car Register in 2007 to mark the 60th anniversary of the first Buckler car built by Derek Buckler',51.368000,-0.794502,'2007-05-05','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4065281328\\/\"}]'),(3884,'Chapel of St. Thomas a Becket\r\n\r\nFounded 1174 by William D\'Albini, 2nd Earl of Arundel. Present building c.1400, restored 1870\'s. After Reformation became the Grammar School.',52.570900,1.110530,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4279935368\\/\"}]'),(3886,'Seeking a fairer society in Norfolk, Robert Kett supported by his brother William, led a rebellion of more than 15000 people in 1549. The rising was crushed and over 3000 died. On 7th December1549 Robert was hanged for treason at Norwich Castle and Willia',52.570900,1.110500,'1999-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4279192915\\/\"}]'),(3888,'The Green Dragon Inn\r\n\r\nA Fourteenth century building standing near the site of the main entrance to the Abbey. Once used as a shop.',52.570999,1.109760,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4279937284\\/\"}]'),(3890,'The Old Fire Station\r\n1882-1967\r\n\r\nPresented to the town by Mrs. Julia de Rubigne Beevor Clarke, it housed the Volunteer Fire Brigade until 1967.',52.570301,1.112220,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4279938316\\/\"}]'),(3892,'Market Cross\r\n\r\nBuilt 1618 to replace a former cross destroyed in the Great Fire of 1615. Formerly the Market Clerk\'s office, this later became the Council chamber and reading room.',52.570202,1.112840,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4279939924\\/\"}]'),(3894,'Wymondham Bridewell\r\n\r\nSir Thomas Beevor,Bart.\r\n\r\n(1726-1817)\r\nbuilt this model prison in 1785',52.570099,1.113210,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4279940858\\/\"}]'),(3896,'Electric Transport\r\n\r\nThis plaque commemorates the Electric Trams which served the people of Peterborough from 1903 to 1930. They ran from Market Place (Cathedral Square) to Dogsthorpe, Newark and Walton, with a depot at Millfield.\r\nElectric trams are now',52.572601,-0.244520,'1996-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4281918953\\/\"}]'),(3898,'Here in 1897 at the old Cavendish Laboratory J. J. Thomson discovered the electron subsequently recognised as the first fundamental particle of physics and the basis of chemical bonding electronics and computing',52.203400,0.119180,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4285530881\\/\"}]'),(3900,'Cavendish Laboratory\r\n1874-1974\r\nEstablished by the Duke of Devonshire and extended by Lord Rayleigh (1908) and Lord Austin (1940), the Cavendish Laboratory housed the Department of Physics from the time of the first Cavendish Professor, James Clerk Maxwe',52.203201,0.118844,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4285535353\\/\"}]'),(3902,'This disk marks the datum point from which in 1725 William Warren, fellow of Trinity Hall, began to measure the one mile points along the roads from Cambridge at which were then set up the first time milestones in Britain since Roman Times.',52.204800,0.117866,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4285546767\\/\"}]'),(3904,'Edward Fitzgerald\r\n1809-1883',52.204700,0.117726,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4285552285\\/\"}]'),(3906,'Charles Lamb lodged here August 1819',52.204800,0.117755,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4286295404\\/\"}]'),(3908,'Between 1939 and 1945 the London School of Economics & Political Science was accommodated in this and nearby buildings by invitation of the Master and Fellows of Peterhouse',52.201000,0.119311,'1989-09-30','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4285566157\\/\"}]'),(3910,'St. Bartholomew\'s Church\r\n\r\nThe remains of the 14th century church, the building was desecrated in 1549.',52.623699,1.298570,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4287335699\\/\"}]'),(3912,'The Church of Saint James\r\n\r\nThis Church, built to the Glory of God, is now in the care of the Norwich Historic Churches Trust. In using this building, remember its origin with thanksgiving.',52.636200,1.300480,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4289054752\\/\"}]'),(3914,'Here stood the church of St Matthew the Apostle 1286',52.633701,1.302420,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4289058690\\/\"}]'),(3916,'Walter De Suffield\r\nDied 1257\r\nBishop of Norwich from 1245-1257 founded this hospital formerly known as St Giles in 1249',52.633202,1.304170,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288318645\\/\"}]'),(3918,'The Wild Man pub is thought to commemorate Peter the Wild Boy (c.1711-1785), a feral child who was, for a time, kept by King George I as a curiosity. In 1751 he mysteriously turned up in \'Norwich and was briefly imprisoned in the Bridewell as a vagrant be',52.629700,1.295680,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288332549\\/\"}]'),(3920,'William Wilkins\r\n1778-1839\r\nProfessor of Architecture at the Royal Academy\r\nBuilt this Shirehall in 1822',52.628799,1.297610,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4289076072\\/\"}]'),(3922,'Anglia Television\r\nThe television studios partly occupy the site of an Anglo-Scandinavian church built about 1000 and its graveyard. The church was an early version of the famous stave churches of Norway.',52.629200,1.298780,'2004-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288336407\\/\"}]'),(3924,'Peter Le Lievre\r\n1812-1878\r\nArtist\r\nlived here',49.451099,-2.538120,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/47332464@N08\\/5030427759\\/\"}]'),(3926,'Site of a 13th century church known as St Cuthbert\'s which was demolished in 1530',52.630100,1.299280,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288337685\\/\"}]'),(3928,'Obelisk Fountain\r\n\r\nBetween 1700 and 1850 machinery used to raise and store water for the higher parts of the City stood on this site. To commemorate this in 1860 a drinking fountain was erected by John Henry Gurney',52.630699,1.298910,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288338839\\/\"}]'),(3930,'Site of the Saxon church of St Michael at Tombland demolished c.1100',52.631001,1.299660,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4289082824\\/\"}]'),(3932,'Augustine Steward House\r\n\r\nBuilt in 1549 it was used as the headquarters of the two Royal Armies sent to quell Ketts Rebellion which took place in that year',52.631599,1.298710,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288383771\\/\"}]'),(3934,'Tombland\r\nThe site of the Anglo-Scandinavian market-place in the 11th century. The name tom is Scandinavian in origin meaning \'empty\' or \'open\'.',52.630699,1.298910,'2004-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288386011\\/\"}]'),(3936,'Fishergate\r\nMeans \'Street of the fisherman\'. Excavations on the river side of the street have uncovered 11th century fish hooks and net weights.',52.633099,1.297190,'2004-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288387705\\/\"}]'),(3938,'Colegate\r\nThe street-name may derive from a Scandinavian personal name Coli with the Old Norse word gata meaning street.',52.633499,1.296760,'2004-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288388797\\/\"}]'),(3940,'The Church of Saint Clement\r\n\r\nThis Church, built to the Glory of God, is now in the care of the Norwich Historic Churches Trust. In using this building, remember its origin with thanksgiving.',52.632198,1.297790,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288389731\\/\"}]'),(3942,'Priors of Ixworth\r\n\r\nThis building incorporates the remains of the town house of the Priors of Ixworth. Later it became the residence of John Aldrich, M.P., Mayor of Norwich 1558 and 1570.',52.633400,1.296340,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288392239\\/\"}]'),(3944,'Pettus House\r\n41/43 Elm Hill.\r\n\r\nThis building was a small part of the original house occupied by the Pettus family from 1550 until 1683.\r\nThey included Thomas Pettus, Sheriff in 1556, Mayor in 1590, also Sir John Pettus, Mayor in 1608.',52.631802,1.297220,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4288393175\\/\"}]'),(3946,'22-24 Elm Hill\r\n\r\nA home of the Paston family in the 15th century. The present house was built by Augustine Steward after the extensive fire of 1507\r\n\r\n[n.b. plaque removed and replace by plaque #4910]',52.631901,1.297360,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4289137576\\/\"}]'),(3948,'Father Ignatius\r\n\r\nFounded an independent Benedictine monastery here in 1864.\r\nAfter two difficult years it was dispersed\r\n\r\n1837-1908',52.631901,1.297360,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4289138338\\/\"}]'),(3950,'Here stood the Palace of Bridewell built by Henry VIII in 1523 and granted by Edward VI in 1553 to the City of London to house Bridewell Royal Hospital founded by Royal Charter in the same year.\r\nThe present building was erected in 1802 and in 1862 the co',51.512699,-0.104245,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298797490\\/\"}]'),(3952,'On this site in the years 1844-1846 were situated the London offices of the Anti-Corn-Law League with which John Bright and Richard Cobden were so closely associated.',51.514000,-0.107384,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298799160\\/\"}]'),(3954,'Site of meeting place of the Fetter Lane Society (1758) and Moravian Chapel. Congregation established 10th November 1742.\r\nMoravian Church headquarters 1875. \r\nDestroyed in air raid 11th May 1941. ',51.515400,-0.109603,'1992-05-09','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298800446\\/\"}]'),(3956,'Site of Newgate \r\nDemolished 1777',51.515999,-0.101634,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298055335\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/5297057568\\/\"}]'),(3958,'Site of Christ\'s Hospital\r\n1552-1902',51.515900,-0.100594,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298057531\\/\"}]'),(3960,'Site of Grey Friars Monastery\r\n1225-1538',51.515900,-0.100594,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298063627\\/\"}]'),(3962,'Near this spot stood Poulters\' Hall\r\n1630-1666',51.515800,-0.098509,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298064593\\/\"}]'),(3964,'Sir John Betjeman\r\n1906-1984\r\nPoet Laureate lived here',51.519001,-0.100112,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298065367\\/\"}]'),(3966,'Site of London House\r\nDestroyed by fire\r\n1766',51.517502,-0.097067,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298066585\\/\"}]'),(3968,'Site of Cooks Hall\r\nDestroyed by fire\r\n1771',51.517101,-0.096848,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298067513\\/\"}]'),(3970,'Site of St John Zachary\r\nDestroyed in the Great Fire 1666',51.515999,-0.095942,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298069899\\/\"}]'),(3972,'Site of Moor Gate.\r\nDemolished\r\n1761.',51.517300,-0.088584,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4298816692\\/\"}]'),(3974,'In vaults below this memorial stone lie the remains of many residents of Henley from the 18th and 19th centuries who worshipped in the Independent Chapel which stood on this site.\r\nMany of those buried here were of Huguenot descent whose families fled Fra',51.534901,-0.903112,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4490611444\\/\"}]'),(3976,'The Corn Exchange\r\n\r\nExchange Street takes its name from the Corn Exchange developed here in 1828 and redeveloped in 1868. Musicians Niccolo Paganini and Franz Liszt both performed here in the 19th century.',52.629002,1.293380,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609902634\\/\"}]'),(3978,'Here stood St Crowche\'s Church\r\nbuilt before 1272\r\ndesecrated and demolished 1551',52.630501,1.294050,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609903616\\/\"}]'),(3980,'Herbert Rumsey Wells\r\n1877-1937\r\nIn 1904 Herbert Rumsey Wells became a partner in his father\'s cap-making firm, T. Wells & Son - the business supplied caps and hats, as well as ties, sashes and ribbons. The workshop was located close to this site. In his ',52.630501,1.296350,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609905302\\/\"}]'),(3982,'John Kirkpatrick\r\n1686-1728\r\nHistorian and Antiquarian\r\nLived in this house',52.630501,1.294560,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609298005\\/\"}]'),(3984,'Plains of Norwich\r\n\r\nThe Dutch and Flemish who came to Norwich in the 16th century left their mark on the Norwich landscape and local language. From the Dutch \'plein\', the Norwich \'plains\' define the squares and open spaces of land, in the midst of the na',52.630901,1.295520,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609911110\\/\"}]'),(3986,'John Garrett\r\n1931-2007\r\nMember of Parliament\r\nReformer',52.631001,1.296140,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609302607\\/\"}]'),(3988,'Reverend Johannes Elison\r\n1581-1639\r\n\r\nJohannes (or John) Elison was senior minister of the Dutch congregation in Norwich, which held its services in Dutch in Blackfriars\' Hall. For more than 300 years the hall was known as the Dutch Church. Elison and hi',52.630901,1.296130,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609303755\\/\"}]'),(3990,'St Christopher\'s Church\r\n\r\nA pre-Conquest church dedicated to St Christopher stood on this site. This dedication is very rare, with only 9 pre-Reformation examples in England. The church burnt down during the reign of Henry III (1216-1272) and the parish ',52.630699,1.296300,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609914344\\/\"}]'),(3992,'United Reformed Church\r\n\r\nOriginally a Congregational Church the current building, along with the adjoining Church rooms on Redwell St, was designed by well-known Norwich architect Edward Boardman. He was also responsible, amongst other project, for conve',52.630901,1.296920,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609918024\\/\"}]'),(3994,'Rev James Wheatley\r\nWho Died May 1775\r\nFirst preached Methodism under the trees of Tombland in 1751',52.631100,1.298480,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609311917\\/\"}]'),(3996,'Norfolk and Norwich Art Circle\r\n1885-1985\r\n\r\nOld Bank of England Chambers where the Norwich Art Circle had its club room and held its first exhibition on 12th September 1885',52.630600,1.297910,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609314615\\/\"}]'),(3998,'George Skipper\r\n1856-1948\r\nArchitect.\r\nDesigned this Royal Arcade in 1899.',52.628201,1.294620,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609317427\\/\"}]'),(4000,'Birthplace of \r\nCharles Haddon Spurgeon\r\n1834-1892\r\nBaptist Preacher and Philanthropist',51.833599,0.695980,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4609820284\\/\"}]'),(4002,'Louis Philippe\r\nKing of France\r\nBorn 1773, died 1850.',52.244598,0.716196,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4616906898\\/\"}]'),(4004,'William Hyde Wollaston\r\nPhysiologist - Chemist\r\nBorn 1776, died 1828',52.244598,0.716196,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4616290869\\/\"}]'),(4006,'In a house formerly standing on this site died John Reve\r\nLast Abbot of Bury\r\nElected 1513 Ejected 1539\r\nDied 1540',52.242901,0.716700,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4616288913\\/\"}]'),(4008,'Adrian Parmenter 1589-1663\r\n\r\nThe first Norwich Office of the Excise was built here in 1643, by Adrian Parmenter. He was a leading Parliamentarian and his home near here was attacked by Royalists in 1648. He was elected Mayor in 1641, but died in 1663 pro',52.626999,1.294920,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4813516360\\/\"}]'),(4010,'George Walpole Earl of Orford 1730-1791\r\n\r\nAlthough at the time considered a rake and an eccentric, he gave generously to public subscriptions for planning improvements made in his time. Formerly known as Hog Hill this street was re-named Orford Hill in h',52.627399,1.294870,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4813520820\\/\"}]'),(4012,'Sir Arthur Michael Samuel 1872-1942\r\n\r\nThe first Jewish Lord Mayor of Norwich was born in Timberhill. He was a generous benefactor to the city, especially in the wake of the disastrous floods in 1912. Later Conservative MP for Farnham, Secretary for Overs',52.627399,1.294870,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4812894227\\/\"}]'),(4014,'John Greene Crosse M.D., F.R.C.S., F.R.S\r\n\r\nThe celebrated surgeon of the Norfolk and Norwich Hospital lived here. He published works on physiognomy, early uses of vaccination in Norfolk and the treatment of bladder stones.',52.627399,1.294870,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4812898527\\/\"}]'),(4016,'The Bell Hotel\r\n\r\nWith its origins in the late 15th century, the Bell (originally the Blue Bell) retains much of the character of an 18th century coaching inn. Its most notable associations are with 18th century and 19th century clubs including the French',52.627399,1.294870,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4813525360\\/\"}]'),(4018,'Lloyd\'s Bank (Grade II)\r\nA Theatre was built here in 1819 by the actor, David Fisher. In 1845, it became the corn Exchange and is now part of the present Bank. In the C16th, the Town Crane stood near this site.',52.455898,1.564250,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4812966061\\/\"}]'),(4020,'Barclay\'s Bank\r\n\r\nThe White Horse Inn stood here before 1760.\r\nIt then became shop premises until replaced by the first purpose-built bank in the Town',52.457401,1.562220,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4813592196\\/\"}]'),(4022,'Town Hall (Grade II)\r\n\r\nBuilt in 1765, in Gothic Revival style on the site of the old Market Cross, originally with an octagonal turret over the doorway\r\n\r\nFormerly the Shire Hall and Courthouse, it is now the Town Hall',52.457802,1.562010,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4813595656\\/\"}]'),(4024,'Samuel Pepys\r\nDiarist 1633-1703\r\n\r\n\"...lay at The Hart a good house and there a fair and pretty town...\"\r\non 15th-16th June 1668\r\nParts of the inn\'s galleries remain in nearby buildings.',51.420101,-1.732410,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4846816975\\/\"}]'),(4026,'Wool trade workshop\r\n\r\nFor centuries, fulling and cloth mills, and cloth workshops such as this one, prospered in Calne.',51.436401,-2.002070,'2000-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4846729455\\/\"}]'),(4028,'Proclamation Steps\r\n\r\nFrom time immemorial Royal Proclamations have been read to the townspeople from these steps.',51.437500,-2.002580,'1977-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4846731311\\/\"}]'),(4030,'Buckeridges Steps\r\n\r\nOpposite stood the stocks and the 17th century town hall',51.438499,-2.005690,'2000-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4847354394\\/\"}]'),(4032,'Walter Goodall George\r\n(1858-1943)\r\nborn near this spot\r\nworld record holder for the mile race\r\n1886-1915\r\nThis plaque placed here to commemorate the centenary of this achievement was unveiled by Sydney Wooderson Esq. who in 1935 became the first Briton t',51.437698,-2.005130,'1986-08-16','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4847356090\\/\"}]'),(4034,'The Wharf\r\n\r\nOpened in 1802, the Calne branch of the Witls and Berks Canal from Stanley terminated here.',51.437698,-2.005050,'2000-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4847357922\\/\"}]'),(4036,'London to Bath Coach Road\r\n\r\nNew Road was built in 1801 by Calne Turnpike Trust. The pump was used to lay the dust.',51.436699,-2.004750,'2000-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4846740759\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4846742711\\/\"}]'),(4038,'1785-1865 creator and first director of The Royal Botanical Gardens at Kew Sir William Jackson Hooker RH FRS LLD CDL the great botanist lived here',52.345299,1.503160,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4869665524\\/\"},{\"url\":\"http:\\/\\/www.geograph.org.uk\\/photo\\/1027287\"}]'),(4040,'1817-1911 succeeded his father as director of Kew 1865 Sir Joseph Dalton Hooker OM GSCI CB FRS MD DCL LLD botanist born in this house',52.345299,1.503160,NULL,'[{\"url\":\"http:\\/\\/www.geograph.org.uk\\/photo\\/1027285\"}]'),(4042,'Helgate Court\r\n\r\nin medieval Norwich Westwick Street had its own gate through the city wall - HELGATE',52.629200,1.290510,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4942108079\\/\"}]'),(4044,'Constructed as the town\'s water supply and possibly the site of the village stocks and pillory',52.943501,1.211140,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4941962751\\/\"}]'),(4046,'This gun was used for coastal defence, possibly at the time of the Spanish Armada',52.944901,1.212260,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4941955981\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4941886299\\/\"}]'),(4048,'Formerly Emery\'s Boatbuilding shed, in use until 1980',52.944901,1.213110,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4941949177\\/\"}]'),(4050,'John Asger\r\n\r\nA former house on this site was occupied by a merchant of Bruges, John Asger. He was elected Mayor of Norwich in 1426. Another of his properties, next to St Lawrence\'s church, was gifted to a group of poor, religious women or beguines. This ',52.630798,1.292420,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4942533172\\/\"}]'),(4052,'This building was erected in 1867 to house the towns first R.N.L.I. lifeboat \'Duncan\'',52.945000,1.213300,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4942531330\\/\"}]'),(4054,'This building was originally a coffee shop circa 1720. And also the site of the fishermen\'s mission hut',52.945301,1.212100,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4941935885\\/\"}]'),(4056,'Dating from about 1320, with additions in the 15th, 16th, 17th and 18th centuries.\r\nIt has been the home of William Barley, Sheriff in 1451, Nicholas Sotherton, Sheriff in 1530, Mayor in 1539, Sir Joseph Paine, Sheriff in 1654, Mayor in 1660.\r\n\r\nPresented',52.630798,1.292510,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4942512352\\/\"}]'),(4058,'Pellegrino Mazzotti\r\nc.1785-c.1870\r\n\r\nA sculptor from Lucca, Italy, Pellegrino Mazzotti established a studio in Charing Cross, adjoining Strangers\' Hall, in 1819. In the years 1821-29 he exhibited with the Norwich Society of Artists. Subjects for his work',52.630798,1.292590,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4942507092\\/\"}]'),(4060,'Arcade Lawn\r\nsite of the towns open air theatre',52.943401,1.210090,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4942481874\\/\"}]'),(4062,'The site of Sheringham\'s first Post Office, 1890',52.944401,1.211680,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4941821331\\/\"}]'),(4064,'Albert Einstein\r\n\r\nfleeing Nazi persecution stopped off en route for America to live in