erly William John Hughes) 1894-1965 Seren Ffilmiau Di-Sain Ganwyd yn Halfway Llanelli Awst 23ain 1894 Y Brawd David yn hwyrach Bu\'n byw yma Silent Film Star Born at Halfway Llanelli 23rd August 1894 Later known as Brother David Li',51.679199,-4.168200,'2010-08-21','[]'),(4124,'Merchant\'s House (c.1500)\r\n(Grade II)\r\n\r\nEarly C16th building, associated with the Mercers and Drapers Company.\r\n\r\nOnce the Town\'s Guildhall, it survived the Great Fire of 1688 and some C16th windows are still to be seen.',52.456501,1.436260,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3876016920\\/\"}]'),(4126,'Earsham House\r\n(Grade II)\r\n\r\nFrederick Smith (1833-1903), lived here.\r\nHe enlarged St. Edmund\'s Church and School and, as Town Reeve, built the St. Edmund\'s almshouses.',52.456699,1.436390,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3875260181\\/\"}]'),(4128,'Earsham House\r\n(Grade II)\r\n\r\nEthel Mann (1861 - 1947)\r\n- Local Historian -\r\nLived here 1933-34 when her classic History of the Town, \"Old Bungay\", was published',52.456699,1.436310,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/3876052980\\/\"}]'),(4130,'J. K. Rowling wrote some of the early chapters of Harry Potter in the rooms on the first floor of this building.',55.947102,-3.185990,'2006-10-06','[]'),(4132,'Made famous as the place of inspiration to writers such as J. K. Rowling, who sat writing much of her early novels in the back room overlooking Edinburgh Castle. Ian Rankin, author of the Rebus novels, and Alexander McCall-Smith have both also frequented ',55.947601,-3.191580,NULL,'[]'),(4134,'Oliver Postgate 1925-2008 animator and author lived here',51.357498,1.441000,'2009-06-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/56111544@N00\\/4885293760\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/39377065@N08\\/5037903609\\/\"}]'),(4138,'Until 1972 this was the site for at least four hundred years of The Angel Inn latterly The Angel Hotel',52.570999,-0.242257,'1984-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4282665208\\/\"}]'),(4140,'Site of St. Thomas a Becket Chapel\r\n\r\nBuilt 1172-1190, it housed relics of this famous Archbishop, murdered in Canterbury Cathedral on 29th December 1170. The Chapel\'s nave was demolished in 1402. Its Gothic Chancel just east of here, is now the Cathedral',52.572498,-0.242381,'1992-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4281923373\\/\"}]'),(4142,'Hier wohnte von 1743 bis 1766 der mathematiker Leonhard Euler 15.IV.1707 18.IX.1783 seinem andenken die stadt Berlin 1907',52.514702,13.379500,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/54145418@N00\\/5038908606\\/\"}]'),(4144,'Robin Tanner renowned etcher and educationalist taught here 1929-1935',51.459499,-2.120600,NULL,'[]'),(4146,'Hier wohnte in den jahren 1821 und 1822 Heinrich Heine geb 13.12.1797 gest 17.2.1856',52.514702,13.379800,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/54145418@N00\\/5038291023\\/\"}]'),(4148,'Henriette Hirschfeld-Tiburtius geb. Pagelsen 14.02-1854 25.08.1911',52.514999,13.381400,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/54145418@N00\\/5038908966\\/\"}]'),(4152,'William Knibb born in Market St. 1803 died in Jamaica 1845 missionary & emancipator',52.398201,-0.727012,NULL,'[]'),(4154,'Frank Alfred Bellamy 1917-1976 comic strip illustrator',52.404499,-0.719608,NULL,'[]'),(4156,'Sir Alfred Edward East RA 20th December 1844-29th September 1913 born near to this site at 20 Lower Street and knighted in 1910 by King George V as an artist of great distinction',52.401199,-0.731694,'2000-10-02','[]'),(4158,'Anthony M. J. Ireson born and died in Kettering 1913 to 2002 writer & historian',52.400600,-0.729100,NULL,'[]'),(4160,'J. L. Carr 1912-?',52.391998,-0.709866,NULL,'[]'),(4162,'Charles Wicksteed born 1847 died 1931 engineer and philanthropist',52.393002,-0.740269,NULL,'[]'),(4176,'John Templeton 1802-1886 Opera singer lived here',51.428600,-0.354627,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/14298302@N07\\/3453203778\\/\"}]'),(4180,'Robert Nesta Marley 1945-81 singer, lyricist and Rastafarian icon lived here 1972',51.521500,-0.132555,'2006-01-01','[]'),(4182,'Constance Winifred MacDonald aka Connie Mark 19232007, community activist, and founder of the Mary Seacole Memorial Association, lived here 2007 -2007 ',51.497101,-0.243286,'2008-01-01','[]'),(4186,'Kelso Chochrane 1936 -1959 Antiguan carpenter and student, was fatally wounded on this site. \r\nHis death outraged and unified the community, leadingto the lastingcosmopolitan tradition in this area of North Kensington',51.523201,-0.207030,'2009-01-01','[]'),(4188,'Amy Ashwood Garvey 1897-1969 feminist, human rights campaigner, Pan-Africanist and first wife of Marcus Garvey lived here between 1934 and 1960',51.519299,-0.211806,'2009-01-01','[]'),(4190,'London Headquarters of the African National Congress 19781994',51.532501,-0.111160,'2010-02-22','[]'),(4192,'Site of Endell Street Military Hospital 1915-1919. Established in former workhouse buildings during the First World War under the command of Dr Flora Murray & Dr Louisa Garrett Anderson, this 573-bed hospital is the only British army hospital to have been',51.515202,-0.125767,NULL,'[]'),(4194,'Site of Briton Brush Works\r\n\r\n(Formerly S.D.Page and Sons Ltd.)\r\nFrom 1890 to 1985 this brush factory employed a large number of the townspeople.',52.567402,1.108290,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4279200137\\/\"}]'),(4206,'Pablo Fanque \r\n1810-1871 \r\nPablo Fanque, real name William Darby, the first black British circus proprietor, was born in Norwich and lived near to this site. He is immortalised in the Beatles song Being for the Benefit of Mr Kite, with the line: \'The Hend',52.624699,1.295250,'2010-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/53621