nders, of which 24 were Flemish and 6 were ',52.629902,1.292140,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4606602215\\/\"}]'),(4220,'Sir Thomas Fowell Buxton\r\nBT. MP. 1786-1845\r\n\r\nBuxton led the Parliamentary campaign responsible for the 1833 Act freeing the 700,000 slaves then held in the West Indies and elsewhere in the British Empire. Married into the Quaker Banking family of the Gu',52.629601,1.291160,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4607213974\\/\"}]'),(4222,'Elizabeth Fry\r\n1780-1845\r\n\r\nBorn into the Quaker Banking family of the Gurneys, who founded what was to become the Barclays Bank empire, Elizabeth Fry worshipped at the Friends Meeting House and went on to become one of the most respected women\'s prison r',52.629601,1.291160,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4606567235\\/\"},{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4607211162\\/\"}]'),(4224,'The Church of Saint Swithin This church, built to the Glory of God, is now in the care of the Norwich Historic Churches Trust. In using this building, remember its origin with thanksgiving.',52.631401,1.287600,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4607165382\\/\"}]'),(4226,'George Borrow\r\n1803-1881\r\nAuthor of \"The Bible in Spain\" \"Lavengro\" \"Romany Rye\" \"Wild Wales\" etc',52.630100,1.287080,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4606541045\\/\"}]'),(4228,'Holkham House\r\nThe design has been attributed to Matthew Brettingham 1699-1769\r\nThe house was owned by his brother Robert\r\nIn the early nineteenth century it was the home of another Norwich Architect, John Thomas Patience',52.630299,1.287020,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/4606537847\\/\"}]'),(4230,'Sarah Glover\r\n1786-1867\r\nOriginator of the Tonic sol-fa notation lived in this house',52.630402,1.287390,NULL,'[{\"ur