7\\/5072554023\\/\"}]'),(4456,'Glenorchy Church. The original Glenorchy Chapel was founded by Willielma, Viscountess Glenorchy, in 1777 following her visit to the town the previous year with her personal chaplain. Sensing the spiritual needs of Exmothians she organised a meeting in the',50.621201,-3.411570,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5073051290\\/\"}]'),(4458,'Sir John Colleton. This site was formerly the Manor House of Rill or Hill, a sub-manor of Marpool, occupied in the early 18th century by Sir John Colleton, retired Administrator of S Carolina. He brought the first magnolias with him which he developed by ',50.621799,-3.411150,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5073229488\\/\"}]'),(4460,'Conrad Martens. This landscape artist, born in London in 1801, moved to Exmouth in 1822 where he lived in Elm Cottage, former manor house, on this site. From 1833 to 1834, he was the ship\'s artist on the Beagle and corresponded with Charles Darwin for man',50.621799,-3.411160,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5072393545\\/\"}]'),(4462,'Primrose Cottage. The last remaining thatched cottage in Exmouth town centre. There has been a dwelling on this site since the early 17th century. Constructed initially with cob walls but later faced with brick and sandstone. Primrose Cottage was at the n',50.622002,-3.410160,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5072603823\\/\"}]'),(4464,'Temple Winds. A late 18th century building erected at the foot of the Beacon Fields. A pharmacy before 1830 and it remained so until the 1960s. The recent name is from the copy of the Temple of the Winds in Athens, built in 1824 at the entrance to the Imp',50.618000,-3.413840,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5073241024\\/\"}]'),(4466,'The Assembly Rooms, built in 1794 as one of the first properties on the Beacon Fields, were the centre of social life through the era of the Napoleonic Wars when Exmouth grew to prominence as a watering place.',50.617599,-3.413930,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5076102068\\/\"}]'),(4468,'The Manor Hotel as it is now known, was one of the first properties constructed on The Beacon in the early 1790\'s. It was initially known as The Beacon Hotel and is the oldest remaining hostelry in Exmouth. It was honoured by a visit from the composer and',50.617500,-3.413790,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5073137328\\/\"}]'),(4470,'Nelson House. Lady Frances \'Fanny\' Nelson, nee Woolward, Duchess of Bronte, wife of Admiral Viscount Lord Horatio Nelson lived here during the period 1803 to 1829 with her son Josiah Nisbet to whom the Admiral was deeply attached. Fanny\'s marriage to Lord',50.617199,-3.413500,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5073163006\\/\"}]'),(4474,'15 The Beacon. Home of Lt Richard Sandford VC RN, who was awarded the VC for conspicuous bravery. Commander of submarine C3 on the St Georges Day raid on Zeebrugge, 23/24th April 1918. He and his crew deliberately ran this explosive filled vessel agrou',50.616600,-3.412840,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5072885078\\/\"}]'),(4476,'Byron Court. Lord Byron married Anne Isabella Milbanke in 1815. Lady Byron and her daughter Ada came to live in this house after Lord Byron deserted them in 1823. On marriage Ada became the Countess of Lovelace and achieved fame by assisting Charles Babba',50.616199,-3.412500,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5072952572\\/\"}]'),(4478,'Royal Beacon Hotel. The hotel was constructed c1810 and was originally called the Marine Hotel. The proprietor changed the name to the Royal Beacon Hotel after a short visit by the King of Saxony in 1844',50.615898,-3.412190,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5073219784\\/\"}]'),(4480,'Beacon Hill House. Built in c1820 as the first of a proposed crescent. Home of Richard Perring, formerly Clerk of the Cheque at Sheerness and Plymouth Dockyards, inventor of improved manufacturing technique for ship\'s anchors and as used extensively by th',50.615898,-3.412050,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5072314369\\/\"}]'),(4482,'Dolforgan Court. Mrs Charlotte Anne Hume Long (1830-1899) came to Exmouth in 1875. Living at Dolforgan Court she became known as \'Lady Bountiful\'. In 1884 she started the hospital in Clarence Road and was its Matron. In 1886, she founded the Maud Hospital',50.615601,-3.411610,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5073009962\\/\"}]'),(4484,'Gun Cliff Gardens. It is thought that the first look-out station appeared at the mouth of the river in Roman times. Since then the narrow channel opposite what is known as the Gun Cliff has been well defended. In the Civil War the site was garrisoned to p',50.614201,-3.410380,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5072492787\\/\"}]'),(4486,'Maer Bay Court. Built c1840 as a home for General Gordon and known originally as Miramar. The General was killed at Khartoum before he was able to occupy the property but it was lived in by his sister. During the period when it was a hotel, Vera Brittain,',50.614399,-3.401620,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5072518693\\/\"}]'),(4490,'The University of London hereby records its sincere apologies that the plans for this building were settled without due consultation with the Russell family and their trustees and therefore without their approval of its design',51.521900,-0.128392,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5027308041\\/\"}]'),(4492,'George William Russell\r\n1867-1935\r\nartist, mystic, writer\r\nborn in\r\nthis house',54.464401,-6.335260,NULL,'[]'),(4494,'Knaresborough Synagogue. In the 13th century a Jewish community lived and worshipped in Knaresborough. The Synagogue was situated at th eexit to Synagogue Lane, at the rear of these buildings, the exact location is unknown. It is believed the Knaresboroug',54.008099,-1.467560,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4848673649\\/\"}]'),(4496,'Oscar Wilde\r\n1854-1900\r\nPoet, dramatist, wit\r\nlived here\r\n1855-1878',53.341099,-6.250530,NULL,'[]'),(4498,'Sir\r\nWilliam Robert Wills Wilde, 1815-1876,\r\naural and ophthalmic\r\nsurgeon, archaeologist,\r\nethnologist, antiquarian,\r\nbiographer, statistician,\r\nnaturist, topographer,\r\nhistorian, folklorist\r\nlived in this house\r\nfrom 1855 to\r\n1876',53.341099,-6.250530,NULL,'[]'),(4500,'Mischa Richter\r\n1910-2001\r\nNew Yorker cartoonist,\r\npainter, author, husband,\r\nfather, grandfather, and\r\nBeachcomber,\r\nlived here 1978-2001',42.055302,-70.180901,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/9161595@N03\\/3073611526\\/\"}]'),(4502,'Scott Joplin\r\n1868-1917\r\nThe King of Ragtime composer and pianist, whose works include the classic rags, The Entertainer and Maple Leaf Rag, and the opera, Treemonisha, lived here in 1917. ',40.812500,-73.944901,NULL,'[]'),(4504,'Cecil B. DeMille\r\n1881-1959\r\nThe director and producer of silent and sound epic films lived here from 1906 to 1913. He directed the first Hollywood feature motion picture, The Squaw Man (1913). Known for his multimillion-dollar spectacles, he produced 70 ',40.807201,-73.966003,NULL,'[]'),(4506,'John Dewey\r\n1859-1952\r\nThe influential educator and philosopher rejected education by rote in favor of learning by doing, which develops the critical thinking skills Dewey believed were essential for participation in a democratic society. He lived h',40.805302,-73.965302,NULL,'[]'),(4508,'Victor Herbert\r\n1859-1924\r\nThe conductor and composer, lived here from 1904 to 1924. During that time, he organized the Victor Herbert Orchestra, wrote the operettas Naughty Marietta and Sweethearts, advocated the Copyright Law of 1909, and he',40.803200,-73.968300,NULL,'[]'),(4510,'Houdini\r\n1874-1926\r\nThe magician lived here from 1904 to 1926, collecting illusions, theatrical memorabilia, and books on psychic phenomena and magic. Famous for daring escapes, no restraints-ropes, chains, straitjackets, bank vaults, or jail cells-could ',40.802200,-73.956200,NULL,'[]'),(4512,'Babe Ruth (George Herman Ruth)\r\n1895-1948\r\nThe Sultan of Swat led the New York Yankees to seven pennants between 1920 and 1934. Ruth hit 714 career home runs, a record until 1974. He lived here for several years, beginning in 1929, and then moved to',40.790901,-73.978600,NULL,'[]'),(4514,'Marian Anderson\r\n1897-1993\r\nIn 1939, after the contralto was refused the use of Constitution Hall by the D.A.R. because of her race, she sang at the Lincoln Memorial for an audience of 75,000. The first African American to perform at The White House (1936',40.791302,-73.953300,NULL,'[]'),(4516,'Al Hirschfeld\r\n1903-2003\r\n20th Century Master of Caricature Residence and Studio In more than 10,000 drawings, Hirschfeld chronicled the celebrity culture of the century. A self-described characterist, his linear calligraphic work of performers, on stage ',40.785500,-73.952202,NULL,'[]'),(4518,'George Gershwin\r\n18981937\r\nThe composer lived here with lyricist Ira Gershwin during 192933, the years they wrote Broadway shows Girl Crazy and, their political satires, Of Thee I Sing, and Let \'Em Eat Cake. ',40.782398,-73.984497,NULL,'[]'),(4520,'Edna Ferber\r\n1887-1968\r\nThe widely-read novelist, short story writer, and playwright, best known for the novel Giant (1952), lived here from 1923 to 1929. Ferbers fiction is distinguished by larger-than-life stories, strong female characters, and disti',40.771702,-73.979301,NULL,'[]'),(4522,'John Steinbeck\r\n1902-1968\r\nThe Pulitzer Prize-winning author of The Grapes of Wrath (1939) was a prolific writer who showed great compassion for the ordinary person caught up in political and economic circumstances beyond his or her control. Often called ',40.769798,-73.960602,NULL,'[]'),(4524,'Andy Warhol\r\n1928-1987\r\nThe Pop artist best known for his silkscreens of cultural icons, including Jackie Kennedy, Marilyn Monroe, Chairman Mao, and Campbells Soup cans, lived here from 1974 to 1987. The founder of Interview magazine and producer of un',40.767601,-73.967499,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/70323761@N00\\/526156186\\/\"}]'),(4526,'John J. Fitzgerald\r\n1894-1963\r\nThe turf reporter, who popularized The Big Apple as a name for N.Y.C. racetracks, lived here from 1934 to 1963. He first heard the term, equating the big time with N.Y.C. racing, in 1920 from African-American sta',40.764000,-73.982498,NULL,'[]'),(4528,'Harold Ross\r\n1892-1951\r\nThe magazine editor, who said \"if you can\'t be funny, be interesting\", lived here when he founded The New Yorker in 1925. At his 1923 \"housewarming\" were Dorothy Parker, Harpo Marx, and George Gershwin. ',40.761902,-73.990997,NULL,'[]'),(4530,'Dorothy Thompson\r\n1893-1961\r\nThe journalist, known as \"the intrepid girl reporter\" lived here from 1941 to 1957. Her book I Saw Hitler and column, \"On the Record,\" were influential in calling for American intervention in World War II. ',40.754002,-73.970299,NULL,'[]'),(4532,'Malvina Hoffman\r\n1887-1966\r\nThe sculptor of numerous works in bronze and marble, a pupil of Rodin, lived here from 1914 to 1966. Her series of 101 portraits, Races of Man (1930-35), a result of an anthropological study trip around the world, reflected the',40.747200,-73.977898,NULL,'[]'),(4534,'Bernard M. Baruch College/CUNY\r\nA center of commerce by the 1840\'s, NYC attracted a growing immigrant population. Townsend Harris, President of the Board of Education, saw the need for publicly-supported higher education. In 1849, his vision was fulfilled',40.739300,-73.984901,NULL,'[]'),(4536,'Horace Greeley',40.738098,-73.989098,NULL,'[]'),(4538,'James Cagney\r\n1899-1986\r\nActor, who set the standard for gangster roles in movies such as Angels With Dirty Faces and The Public Enemy, lived here from 1965 to 1968. Other residents were actress Margaret Hamilton and soprano Emma Thursby. ',40.737099,-73.984901,NULL,'[]'),(4540,'Hart Crane\r\n1899-1932\r\nThe poet and author, one of the \"Lost Generation\" of writers, lived here while supporting himself as an advertising writer. Crane\'s poems \"White Buildings\" and \"The Bridge\" gave harmonious expression to the chaos of urban life. ',40.734699,-74.004204,NULL,'[]'),(4542,'e.e. cummings\r\n1894-1962\r\nThe poet and painter, who made art of commas and parentheses, lived here for the last forty years of his life. He characterized himself as \"an author of pictures, a draughtsman of words.\" ',40.734798,-73.999496,NULL,'[]'),(4544,'Charles Ives\r\n1874-1954\r\nA revolutionary composer, Ives was also a traditional insurance executive. His innovative music builds on American popular and folk tunes, and expands the use of rhythm and tonality. His avant-garde works include Concord, Mass., 1',40.746201,-74.008003,NULL,'[]'),(4546,'Beatrix Farrand\r\n1872-1959\r\nThe landscape gardener lived here from 1872 to 1913. Her 192 commissions include the East Garden (1913) of The White House, and the grounds of Dumbarton Oaks (1922-41), also in Washington, D.C. The niece of the celebrated write',40.733601,-73.994003,NULL,'[]'),(4548,'Frank O\'Hara',40.733700,-73.992996,NULL,'[]'),(4550,'Dawn Powell\r\n1896-1965\r\nThe novelist, playwright, and diarist lived here from 1931-1942, where she wrote Come Back to Sorrento, Turn, Magic Wheel, Angels on Toast, and A Time to Be Born. Born in Ohio, she wrote perceptive novels set in small Midwestern to',40.733101,-73.994698,NULL,'[]'),(4552,'Edwin Arlington Robinson',40.732800,-74.001503,NULL,'[]'),(4554,'Willa Cather / Richard Wright\r\n1873-1947 / 1908-1960\r\nWilla Cather, author of My Antonia, wrote her first novel, Alexander\'s Bridge, here in 1912. Richard Wright, author of Native Son, wrote his autobiography, Black Boy, here in 1945. ',40.732101,-74.000000,NULL,'[]'),(4556,'Joseph Papp\r\n1921-1991\r\nThe dynamic founder and impresario of the New York Shakespeare Festival / Public Theater began offering free performances of Shakespeare in Central Park in 1954. In 1967 he created The Public Theater, the most important not-for-pro',40.731300,-73.993599,NULL,'[]'),(4558,'Edna St. Vincent Millay\r\n1892-1950\r\nThe irreverent poet, who wrote \"my candle burns at both ends\" lived here in 1923-24 at the time she wrote the \"Ballad of the Harp-Weaver,\" for which she won a Pulitzer Prize. ',40.731400,-74.004799,NULL,'[]'),(4560,'Allen Ginsberg\r\n1926-1997\r\nInternationally acclaimed poet and Member of the American Academy of Arts and Letters lived here from August 1958 to March 1961. His signal poem Howl (1956) helped launch The Beat Generation. Kaddish (1961), a mournful elegy for',40.722599,-73.984802,NULL,'[]'),(4562,'Henry Miller\r\n1891-1980\r\nRaised in Brooklyn, the best-selling author is noted for his imaginative, controversial novels Tropic of Cancer (1934), which chronicles his colorful life as an expatriate in Paris, and Tropic of Capricorn (1939), which depicts hi',40.694199,-73.994797,NULL,'[]'),(4564,'Marianne Moore\r\n1887-1972\r\nThe poet, a pioneer of American Modernism (and an avid Brooklyn Dodgers fan), lived here from 1929 to 1965. Her poetry is descriptive, reflective, and minutely detailed, with unique rhyme patterns and verse forms. She was awarde',40.688202,-73.972801,NULL,'[]'),(4566,'Jackie Robinson (Jack Roosevelt Robinson)\r\n1919-1972\r\nThe first African-American major league baseball player lived here from 1947 to 1949. As an infielder for the Brooklyn Dodgers, he was voted Rookie of the Year (1947) and Most Valuable Player (1949), w',40.648300,-73.927200,NU