ociation opened its first office in this building in the year 1905.\r\nThis plaque was unveiled on the 28th June 1965 by The Right Honourable The Lord Mayor of London Sir James Miller D. L. LL D. to mark the Diamond Jubilee of the Automobi',51.513802,-0.110815,'1965-06-28','[]'),(4708,'On this site at 12.15 A.M. on the 25th August 1940 fell the first bomb on the City of London in the Second World War',51.517799,-0.090126,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/5254563171\\/\"}]'),(4718,'Thomas Guy (1644/5-1724) Who founded and endowed Guy\'s Hospital had his home & his bookshop on this site from 1668 until his death in 1724',51.513401,-0.088867,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4470587934\\/\"}]'),(4720,'Site of The King\'s Wardrobe destroyed in the Great Fire 1666',51.512798,-0.100831,NULL,'[]'),(4722,'On this site stood the headquarters of the London Salvage Corps 1907 to 1960',51.513100,-0.094250,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4226084728\\/\"}]'),(4726,'Here lived in 1784 Dositey Obradovich 1742-1811 Eminent Serbian man of letters First Minister of Education in Serbia',51.511501,-0.086968,NULL,'[]'),(4728,'The Clipper. Formerly East India House. In the late 18th Century the site was used as a Tea Warehouse by the East India Company. They used the route from Exmouth to London by coach and horses: this being quicker than passing through Bristol. At that time ',50.618999,-3.414790,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5075529313\\/\"}]'),(4730,'The Delderfield Family. This was the former premises of the Exmouth Chronicle (1882-1962) which moved to the Art Deco property in 1939. The parents ran the newspaper from 1925 until it closed. The two sons Ron (1912-1972) and Eric (1909-1995) achieved fam',50.618500,-3.414130,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/31347728@N07\\/5076140454\\/\"}]'),(4734,'While living in a ho