eatre architect Designed this theatre',51.453098,-2.598410,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5228719230\\/\"}]'),(4898,'The early prosperity of Ambleside as a market town was founded upon sheep and the woollen industry serviced by a network of pack horse tracks. For many hundred of years this was an open site with views across fields and meadows to Loughrigg. Flax was also',54.432499,-2.963000,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/84195101@N00\\/5241846317\\/\"}]'),(4900,'Newcastle Central Railway Station. This plaque celebrates the 150th anniversary of the station, opened by Queen Victoria on 29th August 1850 and built by the York, Newcastle and Berwick Railway. It was designed by John Dobson, Architect and Robert Stephen',54.969101,-1.617310,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/84195101@N00\\/5241846323\\/\"}]'),(4902,'The Bath Hotel by virtue of historic interest merits the title A Heritage Inn',53.379501,-1.482170,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/84195101@N00\\/5241846331\\/\"}]'),(4904,'Renowed \"Birdman\" and Humorist John Charles Gittins 1928-2001',53.372002,-3.189500,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/84195101@N00\\/5241846335\\/\"}]'),(4906,'Robert Martineau (1798-1870) Mayor of Birmingham 1846-1847 Thomas Martineau (1828-1893) Mayor of Birmingham 1884-1887 Ernest Martineau (1861-1952) Lord Mayor of Birmingham 1912-1914 Wilfrid Martineau (1889-1964) Lord Mayor of Birmingham 1940-1941 Denis Ma',52.480301,-1.902950,'2008-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/14113765@N00\\/3960632676\\/\"}]'),(4908,'Britons Arms This is the only house in Elm Hill to escape the fire of 1507 and the cellars date from the 13th century. In the early 15th century it was a \"Beguinage\", a community of lay single women who devoted themselves to a life of prayer and charitabl',52.631401,1.296730,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5361422241\\/\"}]'),(4910,'Paston House In the 14th-15th centuries a house on this site belonged to members of the Paston family, who write the famous Paston Letters which chronicle the lives of a wealthy Norfolk family during the Wars of the Roses. After the fire of 1507, the pres',52.631802,1.296930,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5362043054\\/\"}]'),(4912,'Pettus House This building is the surviving part of a larger house which extended up to the churchyard, occupied in the 16th century by the Pettus Family. The family, members of which are buried in the church of St Simon & St Jude, were Mayors and Sheriff',52.632000,1.297650,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5362053340\\/\"}]'),(4914,'Wright\'s Court The only remaining example of a residential court leading off Elm Hill, and one of only a handful to survive in Norwich. These courts or yards were a common form of habitation for working people in the City from Medieval times until the 192',52.631401,1.296600,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5361451737\\/\"}]'),(4916,'George Rossi Italian gold and silversmith George Rossi, who had fought under Marshal Soult, Napoleon\'s Chief of Staff at Waterloo, came to Norwich and established a business on this site. Rossi\'s survived for 4 generations, until its eventual closure in M',52.629101,1.293210,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5362008224\\/\"}]'),(4918,'Jem Mace 1831-1910 Referred to as the Father of Modern Boxing, Jem Mace became World Heavyweight Champion in 1870 and subsequently became landlord of the White Swan from which Swan Lane takes its name.',52.629601,1.294930,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5361524817\\/\"}]'),(4920,'Maddermarket Theatre Built in 1794 as a Roman Catholic chapel, the theatre was purchased in 1921 by William Nugent Blight Monck CBE and converted into the home of the Guild of Norwich Players. It was the first permanent recreation of an Elizabethan Theatr',52.630199,1.292650,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5361516479\\/\"}]'),(4922,'Leeds Manor House The medieval manor house stood here on \'Castle Hill\'. Its deep moat looped between the river and Boar Lane. Richard Wilson lavishly rebuilt it in 1765 and in 1823 it became Henry Scarborough\'s hotel. The present-day pub is a surviving ex',53.795300,-1.547000,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4706568649\\/\"}]'),(4924,'Sir Edward Elgar lived in a house on this site 1911 1921 Here he composed The Music Makers Falstaff The Spirit of England',51.551899,-0.177063,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4625083200\\/\"}]'),(4928,'Dumb Steeple \r\nBuilt around the 1760s, the monument may have replaced an earlier structure that stood as a guide post to the \'cowford\'. In April 1812 an army of Luddites met here prior to an attack on Cartwrights Mill at Rawfolds.',53.686401,-1.731930,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/23745614@N04\\/3740823776\\/\"}]'),(4930,'The Oldest Chemist\'s Shop A pharmacy from at least 1720, when John Beckwith was the apothecary, The Oldest Chemist\'s Shop became especially famous under WP Lawrence and his son Edmund from 1884 to 1965. The shop ceased to be a pharmacy in 1997.',54.008099,-1.467010,'2006-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4849301138\\/\"}]'),(4932,'Knaresborough Almshouse \r\nThe mouldings and roof structure of these buildings indicate a probable date before 1500, and perhaps around 1450. Originally one large and impressive building, it was listed in the Survey of 1611 as a hospital for six poor folk.',54.008202,-1.467420,'2009-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4848680553\\/\"}]'),(4934,'Oakwood Clock \r\nWas made in 1904 by Potts and Sons, to the design of Leeming and Leeming as the centrepiece of the new Leeds Market Hall. alterations to the Market led to the inspired decision to erect the clock at Oakwood in 1912.',53.827099,-1.504850,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4819566724\\/\"}]'),(4936,'Central Higher Grade School \r\n\r\nThis imposing school was erected by Leeds School Board as the town\'s first local authority secondary school. \r\n\r\nRenamed City of Leeds School in 1928, it merged with Thoresby High School in 1972, and moved to a new site in ',53.800999,-1.545950,NULL,'[]'),(4938,'Fletland Mills \r\nIn 1887 Wright Bros., corn millers, acquired these late 18th and 19th century mills. they produced large quantities of flour and \'horse corn\' for the Leeds district. In 1991 the buildings were splendidly converted to a high quality hotel.',53.794899,-1.538050,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4709786227\\/\"}]'),(4940,'Leeds College of Art  \r\n\r\nFounded in 1846, by Leeds Mechanics\' and Literary Institution, pioneered the teaching of practical art and design in England and USA. Henry Moore and Barbara Hepworth studied here. This building was erected for the college in 190',53.801701,-1.546740,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4707221048\\/\"}]'),(4942,'Brodrick\'s Building \r\n\r\nThese fine shops and offices were designed by Cuthbert Brodrick (1822-1905) the architect of Leeds Town Hall, the Corn Exchange and the Mechanics\' Institute. They were renovated by Trinity Services in 1988. \r\nErected 1864',53.801899,-1.547250,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4706578493\\/\"}]'),(4944,'Bank of England The Bank of England opened a branch in Leeds in 1827 These premises, entered from South Parade, were designed by Phillip Hardwick and erected 1862-64. The Bank remained on this site until moving to King Street in 1971.',53.799198,-1.547140,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4706574455\\/\"}]'),(4946,'Burley Bar Stone \r\n\r\nThis stone, now housed inside the main entrance of Leeds Building Society, marked the medieval boundary between the manorial borough, or town, of Leeds and Leeds Main Riding, the surrounding agricultural land. \r\n\r\nFirst recorded 1726',53.799400,-1.545230,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4706573305\\/\"}]'),(4948,'William Hey\'s House \r\nThis impressive Georgian townhouse was built for William Hey (1736-1819) one of the founders and later Chief Surgeon of Leeds General Infirmary. For 50 years Hey was in the front rank of British surgeons. \r\nArchitect: Thomas Johnson ',53.797901,-1.544900,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4706571639\\/\"}]'),(4952,'Kenneth Williams 1926-1988 Comedy actor and writer Born in a house on this site',51.539200,-0.117775,'2010-06-24','[]'),(4954,'Sir Michael Sobell 1892-1993 Recognising his contribution towards this Centre for the local community',51.559101,-0.113474,'2010-09-07','[]'),(4956,'Sir Osbert Sitwell Bt CH Author and Essayist lived here 1919-63',51.486500,-0.172133,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4691162148\\/\"}]'),(4958,'St Luke\'s Church & Gardens \r\nBuilt 1811-1831 \r\nDesigned by John Foster senior and John Foster junior \r\nStruck by enemy fire May 1941 \r\nRemains as a memorial to those who died',53.401798,-2.975420,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4674207707\\/\"}]'),(4962,'Henry Booth 1789-1869 Founder & Director The Liverpool & Manchester Railway Company born here',53.401600,-2.973310,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4674436610\\/\"}]'),(4964,'On this site June Aylward (1891-1965) Established the first antique shop on Portobello Road',51.513802,-0.203314,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4644586954\\/\"}]'),(4966,'Charles Morgan 1894-1958 Novelist and Critic lived and died here',51.507000,-0.201359,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4644578554\\/\"}]'),(4968,'James McBey 1883-1959 Artist lived here',51.508598,-0.200744,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4643959471\\/\"}]'),(4970,'The second Lord\'s Cricket Ground 1811-1813 Home of MCC was located close to this site',51.529099,-0.166650,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4644557952\\/\"}]'),(4988,'Queen\'s Theatre Built by W G R Sprague, the Queen\'s Theatre opened in 1908 with a comedy \"The Sugar Bowl\". While the Edwardian interior has largely survived, the theatre suffered bomb damage during the last war, re-opening in 1959 with the present exterio',51.511799,-0.132650,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4625003492\\/\"}]'),(4990,'At Messrs. Hatchard\'s in a house on this site the Royal Horticultural Society was founded on the 7th March 1804',51.508598,-0.138205,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/4624387791\\/\"}]'),(4992,'Leeds Charity School The chapel of Harrison\'s Almshouses, which formerly occupied this site, was converted for use by the Charity School in 1726. When the present building was erected in 1815, the institution clothed 80 poor girls in blue and trained them',53.799900,-1.542820,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4610698245\\/\"}]'),(4994,'John Thurloe Secretary of State 1652 Bencher of Lincoln\'s Inn 1654 Lived in Old Square at various times until his death Born 1616 Died 1668',51.516102,-0.112180,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4262931541\\/\"}]'),(4996,'North-Eastern Railway Viaduct This 1500 yard viaduct, including the New Station (now known as City Station) built over the river and canal, is one of the great feats of Victorian civil engineering. It linked railway termini on opposite sides of Leeds. Ere',53.794300,-1.544620,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4611306936\\/\"}]'),(4998,'Mill Hill Chapel This elegant Gothic building, designed by Bowman and Crowther in 1848, replaced the original 17th century chapel. Its congregation - formerly Presbyterian, now Unitarian - dates from 1672. Joseph Priestley, LL.D., F.R.S., discoverer of ox',53.796600,-1.547320,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4610687835\\/\"}]'),(5000,'St. Paul\'s House\r\n\r\nThis building was originally a warehouse and cloth-cutting works built for John Barran, the founder of the mass-production, ready-made clothing industry in Leeds. Barran was a Mayor of Leeds and served as its Liberal M.P. from 1876 - 1',53.798801,-1.552050,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4610687085\\/\"}]'),(5002,'The Victoria Hotel was built in 1865 to serve people attending the Assize Courts newly held at Leeds Town Hall. Its stylish accommodation then comprised spacious dining rooms and bars, a billiard room and large meeting room, private sitting rooms and 28 b',53.800900,-1.549640,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4611292480\\/\"}]'),(5004,'Each and every word...',-23.891300,16.006800,'2010-09-16','[]'),(5006,'Park Square This elegant square formed part of the Wilson family\'s plan to create a high-class residential estate on the site of the medieval park of the Manor of Leeds. Its residents were merchants, clergy, lawyers and surgeons. Built 1788-1810',53.799198,-1.551010,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4610683175\\/\"}]'),(5008,'Leeds Infirmary The General Infirmary moved here from Infirmary Street in 1869. The building, designed by George Gilbert Scott, incorporated ideas from Florence Nightingale. The plan placed it in the foremost rank of European hospitals.',53.801201,-1.551150,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4610682081\\/\"}]'),(5010,'Fairbairn House Originally known as Woodsley House, this monumental villa was built in 1840 for Sir Peter Fairbairn, the textile engineering magnate, and Mayor of Leeds 1858-59. Queen Victoria stayed here in 1858 when she came to open the Town Hall.',53.804600,-1.561190,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4610666383\\/\"}]'),(5012,'The Yorkshire Ladies\' Council of Education was founded in 1876 to promote the education of girls and women and occupied this building between 1928-1988, It served as an administrative centre for Council activities and housed The Yorkshire Ladies\' Secretar',53.806999,-1.550750,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4609060305\\/\"}]'),(5014,'The Church Institute The power house behind the advancement of religious and secular education on the principles of the Church of England in Leeds, and the home for a host of Church organisations. The British Deaf Association was founded here on 24 July 1',53.797901,-1.543970,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4589338692\\/\"}]'),(5016,'Bank Mills This magnificent waterside flax mill and its twin block just upstream were built in 1831-2 for Messrs Hives and Atkinson, former partners of John Marshall the famous Leeds flax spinner. Architect: John Clark',53.791599,-1.528640,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4544026483\\/\"}]'),(5018,'Hotel Metropole This fine hotel designed by Chorley, Connon and Chorley is one of the best examples of terracotta work in Leeds. A remarkable feature is the large stone cupola taken from the town\'s fourth White Cloth Hall (erected in 1868) which formerly ',53.796700,-1.550360,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4431829822\\/\"}]'),(5020,'Edmund Clifton Stoner FRS (1899-1968) The University of Leeds first Professor of Theoretical Physics Cavendish Professor of Physics distinguished for his research on magnetism, atomic structure and astrophysics',53.805099,-1.550270,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4431826174\\/\"}]'),(5022,'The first V-2 rocket on London fell here 8 September 1944 killing three In memory of all V-2 attack victims',51.482101,-0.263929,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/99145208@N00\\/4296679243\\/\"}]'),(5024,'Sir Hiram Maxim (1840-1916) Inventor and Engineer designed and manufactured the Maxim gun in a workshop on these premises',51.521500,-0.108795,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4281489105\\/\"}]'),(5026,'Fryderyk Chopin 1810-1849 gave his first London concert in this house June 23 1848',51.495098,-0.155310,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4241601710\\/\"}]'),(5028,'Thomas Cubitt 1788-1855 Master Builder lived here',51.496399,-0.155102,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4241605836\\/\"}]'),(5030,'Robert, Lord Boothby 1900-1986 Politician, Author and Broadcaster lived here 1946-1986',51.497299,-0.149115,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4240832139\\/\"}]'),(5032,'Sir Charles Wheeler P.R.A. 1892-1975 lived here',51.484901,-0.172441,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4233655635\\/\"}]'),(5034,'Robert Browning 1812-1889 Poet Lived in a cottage near this site 1841-1846',51.474201,-0.041027,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4233652837\\/\"}]'),(5036,'Field Marshal Viscount Montgomery of Alamein 1887-1976 was born here',51.482601,-0.114605,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/44646726@N05\\/4233640265\\/\"}]'),(5038,'Louis Le Prince The pioneer of cinematography had a workshop on this site where he invented a one-lens camera and a projecting machine. Le Prince produced what are believed to be the world\'s first moving pictures taken on Leeds Bridge in 1888.',53.805698,-1.548650,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4134103852\\/\"}]'),(5040,'Lady Betty Hastings of Ledston Hall was a lifelong patron of charities for education, the promotion of Christian knowledge and the relief of poverty. In 1721 when the scheme for building this church was revived, her magnificent donation of 1000 ensured ',53.796101,-1.543740,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/4014505745\\/\"}]'),(5046,'Leeds and Liverpool Canal Warehouse In 1777 this robust stone building was constructed as a terminal warehouse for the Leeds and Liverpool Canal. Started in 1770, the canal was finally completed in 1816 at a cost of 1,200,000 - nearly five times the ori',53.792801,-1.548330,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/3840406911\\/\"}]'),(5048,'Temple Mill The magnificent but highly functional flax spinning mill to your left was erected by John Marshall, founder of the Leeds Flax Industry. Joseph Bonomi modelled it and this office building (added in 1843) on the Egyptian temple at Edfu. Erected ',53.790001,-1.552550,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/3841206828\\/\"}]'),(5050,'Joshua Tetley (1778-1859) In 1822 Joshua Tetley bought William Sykes\' brewery business which had stood here since 1792. Joshua\'s enterprise and fine quality ales created a reputation which for over 150 years has made the name \'Tetleys\' synonymous with the',53.792801,-1.540670,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/3840399991\\/\"}]'),(5052,'White Cloth Hall This superbly restored gateway belonged to the magnificent quadrangular market hall which underpinned the prosperity of Georgian Leeds. Merchants  and 1300 West Riding clothiers met here on Tuesdays and Saturdays to trade in undyed \'white',53.795601,-1.539820,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/3841184816\\/\"}]'),(5054,'The Assembly Rooms Its handsomely decorated ballroom and card rooms made it one of Yorkshire\'s finest assembly rooms. Its patrons were the Leeds merchants and the local nobility and gentry. The ground floor formed the northern range of the third White Clo',53.795700,-1.539270,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/3841185772\\/\"}]'),(5056,'Queen\'s Arcade Named in honour of Queen Victoria\'s Golden Jubilee. Built in 1888-9 by Armistead and Proctor on the site of the Rose and Crown coaching inn which occupied one of Briggate\'s medieval burgage plots. Architect: Edward Clark',53.798199,-1.542270,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/3841174198\\/\"}]'),(5058,'Victoria Quarter\r\n\r\nwas begun in 1900 with the opening of Frank Matcham\'s splendid Country and Cross Arcades. Enhanced in 1990 by covering Queen Victoria Street, the site was formerly medieval yards, Georgian shambles and slaughterhouses.',53.798199,-1.540980,'2000-01-01','[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/3831280852\\/\"}]'),(5060,'John Harrison\r\n1579-1656\r\n\r\nSt. John\'s, one of England\'s most remarkable churches, was built by this celebrated benefactor in 1634. A cloth merchant and co-founder of Leeds Corporation, he further endowed the town with almshouses, a new grammar school and',53.799801,-1.541810,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/17306001@N00\\/3830535046\\/\"}]'),(5062,'George Cruikshank 1792-1878 engraver and illustrator lived here',51.530102,-0.110762,NULL,'[]'),(5068,'12 High Street C17\r\nListed Grade 2, the building was originally a barn converted to housing and sometime commercial use. It is a timber-framed building with brick nogging, standing on a tall irregular stone base. Evidence of a thatched roof existed until ',53.263100,-2.580560,'2008-01-01','[]'),(5070,'Samuel Taylor Coleridge English poet and critic lived in Highgate Village for nineteen years and in this house from 1823 until his death in 1834',51.570099,-0.151784,NULL,'[]'),(5072,'Charles Dickens 1812-1870 Author Stayed here in 1832',51.574402,-0.149541,NULL,'[]'),(5074,'Sir Edward Elgar, composer, was a frequent guest of Alfred E. Rodewald owner of this house C.1900',53.223400,-2.959830,NULL,'[]'),(5076,'Charles Dickens was born in this house on 7th February 1812',50.806301,-1.086490,'1978-01-01','[]'),(5078,'St Thomas a Becket was born in a house near this spot',51.513901,-0.091797,NULL,'[]'),(5080,'The Great Synagogue stood near this site until 1272',51.514301,-0.090838,NULL,'[]'),(5082,'O.F. Franzsen / Knysna Trading Company \r\nDesigned by architects Simpson & Bridgman of Oudtshoorn and built by Coe & Bolton, also of Oudtshoorn, in 1916 on land once owned by Stuttaford & Co. Cape Town, as a General Dealer\'s shop for Olaf Ferdinand Franzse',-34.035500,23.048700,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/5221564181\\/\"}]'),(5084,'Melville\'s \r\nOwned in 1876 by William Milne, a carpenter and undertaker, who built the original building. In 1882 he let one room to the Standard Bank. In 1883 the bank rented the whole building as both Bank and Manager\'s residence. Later owned by Alexand',-34.035599,23.049101,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/5221562165\\/\"}]'),(5086,'The Knysna Library \r\nBuilt at a cost of 1250 on land purchased from William Lloyd for 65, this stone building replaced an earlier public reading room of timber construction which stood on the corner of Main (previously called Church) and Long Streets,',-34.035099,23.048500,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/5221570221\\/\"}]'),(5088,'The War Memorial \r\nOn instigation in 1921 by Harald Thesen, a veteran of the First World War, a subscription list was opened and 450 was collected towards a war memorial to honour