:\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/5221559879\\/\"}]'),(5100,'First National Bank (FNB) \r\nThe first home on this site was built before 1843. This present building dates back to around 1870, and served as a private home and shop. Bought by the Thesen family in 1876. Barclay\'s Bank DCO (later FNB) opened their first b',-34.035198,23.046400,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/5221554065\\/\"}]'),(5102,'Fyfe\'s Pharmacy \r\nThe building stands on land originally bought in 1883 by Thomas Horn of the Royal Hotel from the Anglican Church, which was then acquired in 1884 by Hendrick Carolus Stroebel. George W. Brent Steytler, Knysna\'s first Town Clerk from 1882',-34.035500,23.048800,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/5222165136\\/\"}]'),(5104,'The Lychgate \r\nA lychgate is a gateway covered with a roof found at the traditional entrance to a typical British churchyard. This lychgate was donated by the Thesen family in 1935 in memory of their mother, Mrs. Bessie Thesen, daughter of Captain Christo',-34.035702,23.049999,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/5221577639\\/\"}]'),(5106,'St. George\'s Anglican Church \r\nJohn Rex laid the foundation stone of this church in 1849 built on land donated by his father, George Rex, founder of Knysna. Construction commenced in 1850 based on a plan adapted by Sophy Gray, wife of the first Anglican B',-34.035400,23.050301,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/5222178238\\/\"}]'),(5108,'The new St. George\'s Church \r\nIn April 1919 during the incumbency of the Rev. B.C. Mortimer, a resolution by the parishioners was taken to build a new church which would also serve to be a living monument to those that had died during the Great War 1914-1',-34.035000,23.050100,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/50996541@N00\\/5221581747\\/\"}]'),(5110,'3 Church Street \r\nThis bui