avoy, lodged the many \"beautiful foreign ladies\" whom he brought in 1247 from the Courts of Europe, before marrying them to his wards, a large number of rich young English nobles',51.510502,-0.120956,NULL,'[]'),(5472,'Within these precincts stood the Palace of Savoy, the erection of which was begun by Peter, ninth Count of Savoy and Earl of Richmond, A.D 1246. Henry III King of England bestowed the site \"in vico qui vocato la straunde\" on February 12th 1246 and there w',51.510502,-0.120956,NULL,'[]'),(5474,'On the 13th June 1381, the Palace of the Savoy was burned and destroyed by rebels under the leadership of Wat Tyler. The building of the first section of the new modern Palace of the Savoy was begun in 1889',51.510502,-0.120956,NULL,'[]'),(5476,'His Majesty King Charles I passed through this hall and out of a window nearly over this tablet to the scaffold in Whitehall where he was beheaded on 30th January 1649',51.504799,-0.126165,NULL,'[]'),(5478,'Edward Burne-Jones was born in 1833 in a house on this site demolished 1930',52.479801,-1.900550,NULL,'[]'),(5480,'Norfolk and Norwich Subscription Library From 1837-1976, this building housed a private Subscription Library, founded in 1784 and originally located in St Andrew\'s Hall. The Hall was also the site for Norwich City Library. Founded in 1608, it was the firs',52.622501,1.294900,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5361380293\\/\"}]'),(5482,'33 Timberhill This two-storey brick block dates to around 1700, and has its original attics and cellar. Although the rear dormer is of 19th century date, it is otherwise a very well preserved example of what Timberhill would have looked like in the 18th c',52.625999,1.295970,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5362163206\\/\"}]'),(5484,'Baptist Particular Chapel This 18th century building, which was originally a warehouse, was bought by the Particular Baptists in 1832 for 1150 and converted into a chapel which was used by them from 1833 to 1975. At the time there were eight Baptist cha',52.626598,1.295260,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5361547795\\/\"}]'),(5486,'The Murderers Public House The Murderers/Gardeners Arms Public House is unusual in that it has two names. The Murderers name commemorates events that took place here in June 1895, when Frank Miles murdered his estranged wife Mildred, who lived here with h',52.626900,1.295190,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5362153808\\/\"}]'),(5488,'Fishergate This area may have been the first settlement that can be thought of as \'Norwich\', in its original forms NORTHWIC and NORVIC. Archaeological finds in Fishergate go back to the 8th century AD, and a coin of King Athelstan (reigned 924-939), which',52.634201,1.298440,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5362078366\\/\"}]'),(5490,'Hilltop Chapel erected 1629 mainly at the expense of the Bright family of Carbrook Hall, & sole Anglican church for Attercliffe until 1826. The churchyard contains memorials to many famous Attercliffe citizens including Benjamin Huntsman inventor of cruci',53.399200,-1.427080,NULL,'[]'),(5492,'The Bramley Apple Tree was grown from a pip by a young lady, Mary Anne Brailsford between 1809 & 1815. It was thought it came from an apple grown on a tree at the bottom of her garden (now No. 75). One seedling produced very fine apples in 1837 when the n',53.076099,-0.948208,NULL,'[]'),(5494,'First bomb of World War One to fall from a zeppelin\r\non London dropped in the garden of The Nevill Arms Public House 30 May 1915',51.556301,-0.079200,NULL,'[]'),(5496,'Herbert Howells\r\n1892-1983\r\nComposer\r\nand\r\nTeacher\r\nlived here\r\n1946-1983',51.472000,-0.244587,'2011-01-14','[]'),(5498,'In 1233 Walter de Gray, Archbishop of York, forgave the sins of those who contributed to the building of this bridge. The original was only 3.6 metres wide 