h City Football Club was held on this site - then known as the Criterion Cafe',52.627499,1.294620,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5362141144\\/\"}]'),(5534,'Sir Thomas Browne \r\nPhysician and Author of Religio Medici \r\n1605-1682 \r\n\r\nLived in a house that once stood near this plaque \r\nAt the junction of the Haymarket and Orford Place',52.626999,1.293530,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5361582061\\/\"}]'),(5536,'On 8th March, 1600 \r\nWilliam Kemp \r\nElizabethan actor and clown jumped over the wall opposite to complete his Nine Daies Wonder a morris dance from London to Norwich',52.630199,1.292660,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/20814240@N00\\/5362131958\\/\"}]'),(5538,'Before 1270 this market place was colonised with \'rows\' of stalls: \r\n<-Butchers\' Row \r\nShoemakers\' Row \r\nLockiers\' Row ->',52.367599,-2.720100,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/99145208@N00\\/5305509331\\/\"}]'),(5540,'The Conduit \r\nA water supply point, given to the town in 1581 by Sir Henry Sidney, was moved here from the High Cross in 1743.',52.367500,-2.719940,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/99145208@N00\\/5305509589\\/\"}]'),(5542,'8 High Street. The George Inn in the 17th century, Remains of a 16th century building found during restorations in 1979.',52.367699,-2.719880,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/99145208@N00\\/5306103426\\/\"}]'),(5544,'Battle for Bull Centre \r\nAugust 1908 \r\nSalvationists Ensigns William and Elizabeth Roy and \'Mother\' Elisabeth Wood were jailed for preaching the gospel on this street. \r\nThe campaign for their release changed policing of public gatherings forever.',51.444302,0.217387,NULL,'[{\"url\":\"http:\\/\\/www.flickr.com\\/photos\\/26650236@N07\\/5345792913\\/\"}]');
